import React, {FC, useEffect, useState} from "react"
import { Formik, Field, Form, FormikHelpers } from 'formik';

import {capitalize} from "../../helpers/capitalize";
import {findYaCode} from "../../helpers/findYaCode";

export interface Values {
  from: string;
  to: string;
  // line: string;
  // date?: Date | null;
}

interface Props {
  setParams: React.Dispatch<React.SetStateAction<Values>>;
  stations: any[];
}

// ...props ?
const Finder: FC<Props> = ({setParams, stations}) => {

  return (
    <>
      <Formik
        initialValues={{
          from: 'Нахабино',
          to: 'Дедовск',
          // line: '',
          // date: null,
        }}
        onSubmit={(
          values: Values,
          { setSubmitting }: FormikHelpers<Values>
        ) => {
          // @ts-ignore
          setParams({...values, from: findYaCode(capitalize(values.from), stations), to: findYaCode(capitalize(values.to), stations)});
          // setYaCodeFrom(findYaCode(capitalize(values.from), stations));
          // setYaCodeTo(findYaCode(capitalize(values.to), stations));
          setSubmitting(false);
        }}
      >
        <Form>
          <label htmlFor="from">Откуда</label>
          <Field id="from" name="from" placeholder="Гражданская" />

          <label htmlFor="to">Куда</label>
          <Field id="to" name="to" placeholder="Нахабино" />

          {/*<label htmlFor="line">Направление</label>*/}
          {/*  <Field*/}
          {/*    component="select"*/}
          {/*    id="line"*/}
          {/*    name="line"*/}
          {/*    multiple={false}>*/}
          {/*{lines.map((line) => <option value={line} key={line}>{line}</option>)}*/}
          {/*  </Field>*/}

          <button type="submit">Submit</button>
        </Form>
      </Formik>
    </>
  )
}

export default Finder
